  <>
    <ul>
      <li> sum of two no is {sum(10,20)} </li>
      <li> sub of two no is {su(10,20)} </li>
      <li> mul of two no is {sum(10,20)} </li>
      <li> div of two no is {sum(10,20)} </li>

    </ul>
  </>,
  document.getElementById("root")

);
